import Form from "react-bootstrap/Form";

export function Cities(props){
    let {cities} = props
    console.log(cities)
    return (
        <div>
            <Form.Select aria-label="City Selector">
                {cities.map((id, name) => {
                        return (
                            <option value={id}>{name}</option>
                        );
                    })}
            </Form.Select>
        </div>
    );
}
